{"code":"from math import isfinite
prices = {
    'NVDA': {
        2020: 13.01911449432373,
        2021: 29.35577392578125,
        2022: 14.600198745727539,
        2023: 49.4971809387207,
        2024: 134.26075744628906,
    },
    'AAPL': {
        2020: 129.29261779785156,
        2021: 174.09014892578125,
        2022: 128.123046875,
        2023: 190.9136505126953,
        2024: 249.5341796875,
    }
}

# Round helper
rnd2 = lambda x: round(x + 1e-12, 2)

# Annual returns
returns = {
    t: {y: rnd2((prices[t][y]/prices[t][y-1]-1)*100.0) for y in [2021,2022,2023,2024] }
    for t in prices
}

# Cumulative values from 2020 YE
cum_values = {
    t: {y: rnd2(10000.0 * prices[t][y]/prices[t][2020]) for y in [2021,2022,2023,2024]}
    for t in prices
}

# Investment decision metrics (21->24)
id_cum = {t: rnd2((prices[t][2024]/prices[t][2021]-1)*100.0) for t in prices}
id_cagr = {t: rnd2(((prices[t][2024]/prices[t][2021])**(1/3.0)-1)*100.0) for t in prices}

# Revenues (USD) from Yahoo income statements gathered earlier
# NVDA FY ends Jan; map calendar year row to FY ending that year
nvda_rev = {2022: 26914000000.0, 2023: 26974000000.0, 2024: 60922000000.0}
aapl_rev = {2022: 394328000000.0, 2023: 383285000000.0, 2024: 391035000000.0}

# EPS (diluted) for PE calc
nvda_eps = {2022: 0.385, 2023: 0.174, 2024: 1.19}
aapl_eps = {2022: 6.11, 2023: 6.13, 2024: 6.08}

# Year-end prices (rounded to 2 decimals already from earlier calc)
pe_nvda = {y: rnd2(prices['NVDA'][y]/nvda_eps[y]) for y in [2022,2023,2024]}
pe_aapl = {y: rnd2(prices['AAPL'][y]/aapl_eps[y]) for y in [2022,2023,2024]}

# Revenue growth rates (%)
# For 2022 we need 2021 revenue; we have AAPL 2021 from Yahoo (365,817,000,000). NVDA 2021 not fetched; leave None.
aapl_rev_2021 = 365817000000.0
nvda_rev_2021 = None

aapl_growth = {
    2022: rnd2((aapl_rev[2022]/aapl_rev_2021-1)*100.0),
    2023: rnd2((aapl_rev[2023]/aapl_rev[2022]-1)*100.0),
    2024: rnd2((aapl_rev[2024]/aapl_rev[2023]-1)*100.0),
}

nvda_growth = {
    2022: None,
    2023: rnd2((nvda_rev[2023]/nvda_rev[2022]-1)*100.0),
    2024: rnd2((nvda_rev[2024]/nvda_rev[2023]-1)*100.0),
}

# Prepare arrays for Google Sheets
# Investment Return Comparison (A1:G5)
irc_header = [
    ["Year","NVDA Year-end Price","AAPL Year-end Price","NVDA Annual Return (%)","AAPL Annual Return (%)","NVDA Cumulative Value ($10,000)","AAPL Cumulative Value ($10,000)"],
]
irc_rows = []
for y in [2021,2022,2023,2024]:
    irc_rows.append([
        y,
        rnd2(prices['NVDA'][y]),
        rnd2(prices['AAPL'][y]),
        returns['NVDA'][y],
        returns['AAPL'][y],
        cum_values['NVDA'][y],
        cum_values['AAPL'][y],
    ])

# Fundamental Analysis (A1:G4)
fa_header = [[
    "Year",
    "NVDA Annual Revenue (Billion USD)",
    "AAPL Annual Revenue (Billion USD)",
    "NVDA Year-end P/E",
    "AAPL Year-end P/E",
    "NVDA Revenue Growth Rate (%)",
    "AAPL Revenue Growth Rate (%)"
]]
fa_rows = []
for y in [2022,2023,2024]:
    nvda_rev_bil = None if nvda_rev.get(y) is None else rnd2(nvda_rev[y]/1e9)
    aapl_rev_bil = rnd2(aapl_rev[y]/1e9)
    nvda_pe = pe_nvda[y]
    aapl_pe = pe_aapl[y]
    nvda_gr = nvda_growth[y]
    aapl_gr = aapl_growth[y]
    fa_rows.append([
        y,
        nvda_rev_bil,
        aapl_rev_bil,
        nvda_pe,
        aapl_pe,
        nvda_gr,
        aapl_gr,
    ])

print({
    'irc': irc_header+irc_rows,
    'fa': fa_header+fa_rows,
    'id_cum': id_cum,
    'id_cagr': id_cagr,
})
